', '', '', '', '', '', '', '', '', '1664', '1', '<b>Intervensi Mandiri :</b><div>Monitor kesadaran, monitor TTV, Monitor pola nafas (Frekuensi, kedalaman, usaha nafas), Monitor bunyi nafas tambahan (mis. gurgling, mengi, wheezing, ronchi kering). Identifikasi penyebab hipervolemia. Monitor tanda hemokonsentrasi (misal kadar natrium). Monitor efek samping diuretik, , Fasilitasi melakukan mobilisasi fisik, jika perlu, Jelaskan tujuan dan prosedur ambulasi.</div><div><br></div><div></div><div><b>Intervensi Kolaborasi :</b></div><div>- Rongten Thorax ( 30/5/2025)</div><div>- USG Abdomen ( 3/5/2025) DPJP (+)</div><div>- Nebu ( 2x/hari ( Pulmicort) dan 3x/hari ( Ventolin )</div><div>- Post HD Pertama ( 4/5/2025) UF 1000 Ml selama 2 jam ( minimal Heparin )</div><div>- DR dan Ureum Creatinin ( 5/6/2025) 6 Jam Post HD ----&gt; DPJP (+)</div><div>- Follow up jadwal HD ke 2(-)</div><div>- pinru jika Saturai oksigen > 95Þngan NK</div><div><br></div>', NULL, '1664', 0, NULL, '2025-06-06 06:04:47')
